matrix = [[0] * n for _ in range(n)]
for i in range(n // 2):
    for j in range(n // 2):
        for k, am in cnt_num.items():
            if am >= 4:
                matrix[i][j] = k
                matrix[i][n - j - 1] = k
                matrix[n - i - 1][j] = k
